INSERT INTO `article` (`id`, `titre`, `text`, `date`, `idUser`) VALUES
(25, 'L''idiot', 'Il était environ neuf heures du matin ; c''était à\nla fin de novembre, par un temps de dégel. Le\ntrain de Varsovie filait à toute vapeur vers\nPétersbourg. L''humidité et la brume étaient telles\nque le jour avait peine à percer ; à dix pas à droite\net à gauche de la voie on distinguait malaisément\nquoi que ce fût par les fenêtres du wagon. Parmi\nles voyageurs, il y en avait qui revenaient de\nl''étranger ; mais les compartiments de troisième,\nles plus remplis, étaient occupés par de petites\ngens affairées qui ne venaient pas de bien loin.\nTous, naturellement, étaient fatigués et transis ;\nleurs yeux étaient bouffis, leur visage reflétait la\npâleur du brouillard.', '2016-10-18', 6),
(26, 'Crime et châtiment', 'Par une soirée extrêmement chaude du début\r\nde juillet, un jeune homme sortit de la toute petite\r\nchambre qu''il louait dans la ruelle S... et se\r\ndirigea d''un pas indécis et lent, vers le pont K...\r\nIl eut la chance de ne pas rencontrer sa\r\npropriétaire dans l''escalier.\r\nSa mansarde se trouvait sous le toit d?une\r\ngrande maison à cinq étages et ressemblait plutôt\r\nà un placard qu''à une pièce. Quant à la logeuse\r\nqui lui louait la chambre avec le service et la\r\npension, elle occupait un appartement à l''étage\r\nau-dessous, et le jeune homme, lorsqu''il sortait,\r\nétait obligé, de passer devant la porte de sa\r\ncuisine, la plupart du temps grande ouverte sur\r\nl?escalier. À chaque fois, il en éprouvait une\r\nsensation maladive de vague effroi, qui\r\nl?humiliait, et son visage se renfrognait. Il était\r\nterriblement endetté auprès de sa logeuse et il', '2016-10-19', 6),
(27, 'L es Frères Karamazov', 'Dans la riche personnalité de Dostoïevski, on\r\npourrait distinguer quatre aspects : l?écrivain, le\r\nnévrosé, le moraliste et le pécheur. Comment\r\ns?orienter dans cette déroutante complexité ?\r\nL?écrivain est ce qu?il y a de plus\r\nincontestable : il a sa place non loin derrière\r\nShakespeare. Les Frères Karamazov sont le\r\nroman le plus imposant qui ait jamais été écrit et\r\non ne saurait surestimer l?épisode du Grand\r\nInquisiteur, une des plus hautes performances de\r\nla littérature mondiale. Mais l?analyse ne peut\r\nmalheureusement que déposer les armes devant le\r\nproblème du créateur littéraire.', '2016-10-22', 24),
(28, 'LES PAUVRES GENS', 'Hier j?ai été heureux, excessivement heureux, on ne\r\npeut pas plus heureux ! Une fois, du moins, dans votre\r\nvie, entêtée, vous m?avez écouté. Le soir, à huit heures, je\r\nm?éveille (vous savez, matotchka, que j?aime à dormir une couple d?heures quand je suis revenu du bureau), je\r\nm?étais procuré une bougie, j?apprête mon papier, je\r\ntaille ma plume ; soudain, par hasard, je lève les yeux, ?\r\nvraiment, mon c?ur s?est mis à sauter si fort ! Ainsi,\r\nvous avez tout de même compris ce que je voulais, ce\r\ndont mon c?ur avait envie ! Je vois qu?à votre fenêtre un\r\npetit coin du rideau est relevé et accroché au pot de bal-\r\nsamine, exactement comme je vous l?avais insinué l?autre\r\njour ! J?ai même cru alors apercevoir votre visage à la fe-\r\nnêtre ; il m?a semblé que vous aussi me regardiez de votre\r\nchambrette, que vous aussi pensiez à moi. Et qu?il a été\r\nvexant pour moi, ma chère, de n?avoir pas bien pu voir\r\nvotre joli petit minois ! Il fut un temps où nous aussi\r\nvoyions clair, matotchka. Vieillesse n?est pas liesse, ma\r\nbonne amie ! Maintenant je vois toujours trouble ; pour\r\npeu que je travaille le soir, que je fasse quelques écritures,\r\nle lendemain matin j?ai les yeux rouges et larmoyants ;\r\ndevant les étrangers je suis même honteux de pleurer ain-\r\nsi. Pourtant, en imagination, j?ai vu briller votre sourire,\r\nmon petit ange, votre bon, votre affable petit sourire, et\r\ndans mon c?ur ç?a été tout à fait la même sensation que\r\nquand je vous ai embrassée, Varinka, ? vous en souve-\r\nnez-vous, mon petit ange ? Savez-vous, chérie, il m?a\r\nmême semblé que vous me menaciez du doigt ! Est-ce\r\nvrai, espiègle ? Ne manquez pas de me retracer tout cela\r\nen détail dans votre lettre.\r\nEh bien, mais comment trouvez-vous notre invention\r\nau sujet de votre rideau, Varinka ? Très-gentille, n?est-ce\r\npas ? Que je me mette au travail, que je me couche, que\r\nje m?éveille, je sais que là vous aussi pensez à moi, que\r\nvous vous souvenez de moi, que vous-même êtes bien portante et gaie. Vous baissez le rideau, ? cela signifie :\r\n« Adieu, Makar Alexéiévitch, il est temps de se cou-\r\ncher ! » Vous le relevez, ? cela veut dire : « Bonjour,\r\nMakar Alexéiévitch ; comment avez-vous dormi ? » ou :\r\n« Comment va votre santé, Makar Alexéiévitch ? Quant à\r\nmoi, grâce au Créateur, je vais bien et suis contente ! »\r\nVoyez-vous, mon âme, comme c?est bien imaginé ! On\r\nn?a même pas besoin de s?écrire ! Un truc ingénieux, pas\r\nvrai ? Et c?est moi qui ai eu cette petite idée ! Hein, quel\r\nhomme je suis pour ces choses-là, Varvara Alexéievna !\r\nJe vous apprends, matotchka, Varvara Alexéievna,\r\nque, contre mon attente, j?ai dormi convenablement cette\r\nnuit, ce dont je suis très-content ; en général, on ne dort\r\npas bien dans un nouveau logement la première fois\r\nqu?on y couche ; c?est la même chose et ce n?est pas la\r\nmême chose ! Ce matin, je me suis levé tout guilleret,\r\ntout joyeux ! Quelle belle matinée aujourd?hui, matot-\r\nchka ! Chez nous on a ouvert une fenêtre ; le soleil brille,\r\nles oiseaux gazouillent, l?air est embaumé des senteurs du\r\nprintemps, et la nature entière se ranime ; ? eh bien,\r\ntout le reste ici correspondait à cela, tout était dans la\r\nnote, printanier. J?ai même fait aujourd?hui des rêves as-\r\nsez agréables, qui tous avaient trait à vous, Varinka. Je\r\nvous ai comparée au petit oiseau du ciel, créé pour la joie\r\ndes hommes et pour l?ornement de la nature. Je songeais\r\naussi, Varinka, que nous autres hommes, qui vivons dans\r\nles soucis et l?agitation, nous devions envier le bonheur\r\ninnocent et calme des oiseaux du ciel, ? et toutes sortes\r\nd?idées dans ce genre-là ; je veux dire que je faisais tou-\r\njours de ces comparaisons lointaines. J?ai là un livre, Va-\r\nrinka, où se trouvent les mêmes pensées ; tout cela y est développé très-longuement', '2016-10-22', 24),
(29, 'La terre et le sang de Mouloud FERAOUN', 'Dans La Terre et le Sang, Amer-ou-Kaci a quitté très jeune sa Kabylie natale pour aller travailler dans les mines françaises. Arrivé en pays d''exil, il décide de ne plus revenir dans son village et oublie ses parents dont il est le fils unique. Pour eux, celui qui est parti travailler pour préserver leurs derniers jours du dénuement n''est plus qu''« un enjeu perdu ». Quelques années plus tard, il revient dans son village. Son père est décédé ; sa mère a connu la famine et le froid mais a vécu dignement de son travail.\r\nLe retour d''Amer en Kabylie veut rompre avec l''expérience ratée de l''exil. Ce retour s''avère être un mauvais choix car, désormais, il doit payer sa dette. En France, dans les mines du Nord, Amer tue accidentellement son oncle Rabah dont la famille fait semblant de pardonner au cousin son crime involontaire et sa trahison, à l''exception de l''oncle Slimane ? frère du défunt ? pour qui le retour de l''exilé est inespéré.\r\nFidèle à la linéarité et au réalisme de ses récits, Mouloud Feraoun construit son roman autour des isotopies de la « terre » et du « sang ». Amer a rompu le lien ombilical avec sa terre et a laissé s''échapper son sang. Il doit maintenant les reconquérir. À son insu, il se coupera définitivement de la première et profanera encore une fois le second. ', '2016-10-27', 27),
(30, 'L''opium est le baton de Mouloud Mammeri', ' Pour le docteur Bachir Lazrak le fait d''avoir étudié en France rend sa position ambiguë vis-à-vis de la guerre d?Algérie. Pourtant, par l?entremise de son ami Ramdane, il quitte Alger pour la Kabylie.\r\n\r\n            Sa mission consiste à rallier la Wilaya III afin de réorganiser le service sanitaire. Il transite par Tala son village natal. Là, il est confronté avec la dure réalité de la guerre : le village a beaucoup changé. Ali son jeune frère a rejoint les rangs de l?ALN, Bélaid l?aîné, par contre, est du côté des Français. Bachir est révolté par la lâcheté des habitants de Talal. Il apprend en outre que Ramadane a été arrêté  par la police à Alger. Ceci précipite son départ pour la Wilaya III où il mène à bien sa mission. Lors d?un accrochage, il est blessé par l?ennemi : il doit quitter l?Algérie pour Larache (Maroc). De passage à Alger il est arrêté et conduit à la DST pour subir un interrogatoire mais il réussit finalement à se tirer d?affaire.\r\n\r\n          - Arrivé au Maroc il s?avère qu?il n?est pas apte à reprendre ses activités : il en profite pour visiter le pays et se reposer.\r\n\r\n             Pendant ce temps, à Tala, la situation est dramatique pour la population civile. L?action psychologique des soldats français n?est pas concluante et l?armée sévit en employant la force. A la fin de l?été Bachir doit retourner en Algérie.\r\n\r\n             Tala : les villageois sont réunis sur la place : Ali leur héros est exécuté sous leurs yeux : à la suite de quoi le village est bombardé après avoir été vidé de ses habitants.\r\n\r\n             Bachir est retourné à Alger, la guerre n?est pas encore finie. ', '2016-10-27', 23);

